import React, { Component } from "react";
import axios from "axios";
class Clock extends Component {
  constructor(props) {
    super(props);
    this.state = {
      post: [],
    };
  }
  componentDidMount() {
    axios
      .get(
        "https://api.nytimes.com/svc/topstories/v2/sports.json?api-key=T54BYK2WZWF3MRyp9FLqJvVh3z7YziYa"
      )
      .then((users) => {
        this.setState({
          post: users.data.results,
        });
      });
  }
  componentWillUnmount() {}
  render() {
    console.log(this.state);
    return (
      <div>
        <h1>Hello, World!</h1>
        {this.state.post.map((post, indx) => (
          <div key={indx}>
            <img
              src="https://static01.nyt.com/images/2021/08/05/world/05olympics-apologies1b/05olympics-apologies1b-thumbStandard.jpg"
              alt="pic"
            />
            <h2>title : {post.title}</h2>
            <p>section: {post.section}</p>
          </div>
        ))}
      </div>
    );
  }
}

export default Clock;
